import React from 'react';
import Post from './Post/Post';

const controls = [
    {label:'Salad', image:'https://homepages.cae.wisc.edu/~ece533/images/airplane.png'},
    {label:'Bacon', image:'https://homepages.cae.wisc.edu/~ece533/images/arctichare.png'},
    {label:'Cheese', image:'https://homepages.cae.wisc.edu/~ece533/images/boat.png'},
    {label:'Meat', image:'https://homepages.cae.wisc.edu/~ece533/images/cat.png'},
];

const posts = (props)=>(
    <div>
    <div>
        {props.postsData.map(ctrl=>(
            <Post 
                key={ctrl.username} 
                name={ctrl.username}
                image={ctrl.image}/>
        ))}
        
    </div>
    <style jsx>
    {`
        div{
            width: 100%;
            display: flex;
            flex-flow: column;
            align-items: center;
            box-shadow: 0 2px 1px #ccc;
            margin: auto;
            padding: 10px 0;
        }

        @keyframes enable {
            0% {
                transform: scale(1);
            }
            60% {
                transform: scale(1.1);
            }
            100% {
                transform: scale(1);
            }
            @media(min-width:1000px )and (min-height: 700px){
                div{
                    width: 700px;
                    height: 600px;
                }
            }

            @media(min-width:500px )and (min-height: 401px){
                div{
                    width: 450px;
                    height: 400px;
                }
            }

            @media(min-width:500px )and (min-height: 400px){
                div{
                    width: 350px;
                    height: 300px;
                }
            }
}
       
    `}    
    </style>
    </div>
);



export default posts;
